import React from "react"

const SignUp = React.forwardRef(({ style, ...rest }, ref) => {

    const styles = {
      ...style,
      background: 'white',
      width: "15rem",
      height: "20rem",
      padding: 20,
      borderRadius: 4,
      border:"1px solid #407BC4",
      position: 'absolute',
      boxShadow: '0 3px 6px -2px rgba(0, 0, 0, 0.6)',
      top: "7rem",
      left: 0,
      right: 0
    };

    return (
      <div {...rest} style={styles} ref={ref}>
        <h2>Create an Account</h2>
      </div>
    );
  });

export default SignUp
